import './productlist.css';

import React from 'react';

import ProductImg from '../../../assets/imgs/desktop1.avif';

const Productlistcard= ()=>{
    return(
        
        <section className='showcase-container'>
        
          <div className='product-card'>
            <div className='product-listing-img'>
                <img src={ProductImg} alt='product-listing-img' className='product-img'></img>
            </div>
            <div className='prodcut-listing-details'>
            <h3 className='product-name'>Apple Studio Display</h3>
            <p className='product-price'>$8'200.500</p>
            <a href='#' className='product-button'>Button</a>
            </div>
            </div>

           
        </section>
    )
}
export default Productlistcard ;
